import componentsImg from "./assets/logo192.png";

export const CORE_CONCEPTS = [
    {
        image: componentsImg,
        title: 'Components 0',
        description:
            'The core UI building block.'
    },
    {
        image: componentsImg,
        title: 'Components 1',
        description:
            'The core UI building block.'
    },
    {
        image: componentsImg,
        title: 'Components 2',
        description:
            'The core UI building block.'
    },
    {
        image: componentsImg,
        title: 'Components 3',
        description:
            'The core UI building block.'
    },
]
